import React, {Component} from "react";
import {withRouter} from "react-router-dom";

class Remind extends Component {
    constructor() {
        super();
        this.state = {}
    }
    add=()=>{
        this.props.history.push("/Remind")
    }
    render() {
        return (
            <div className={"Remind"}>
                <img alt={"标本"} onClick={this.add} className={"remindimg"} src={"https://image.hongbeibang.com/FjmYGE5z6RvQL-_fdLKuSGYfmwO2?48X48&imageView2/1/w/48/h/48"}/>
            </div>
        )

    }

}

export default withRouter(Remind);
